 ('node/add/groupwikis','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:10:\"groupwikis\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/groupwikis','Open Goup Page','check_plain','',6,'','Create a Wiki group post that any group member may edit. New pages sends an email notification to all the group members. ','',0,'modules/node/node.pages.inc'),
 ('node/add/page','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:4:\"page\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/page','Page','check_plain','',6,'','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',0,'modules/node/node.pages.inc'),
 ('node/add/question','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:8:\"question\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/question','Questions and Answers','check_plain','',6,'','','',0,'modules/node/node.pages.inc'),
 ('node/add/story','','','node_access','a:2:{i:0;s:6:\"create\";i:1;s:5:\"story\";}','node_add','a:1:{i:0;i:2;}',7,3,'','node/add/story','News and Reviews','check_plain','',6,'','A <em>News & Reviews story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',0,'modules/node/node.pages.inc'),
