INSERT INTO `d_node_type` (`type`,`name`,`module`,`description`,`help`,`has_title`,`title_label`,`has_body`,`body_label`,`min_word_count`,`custom`,`modified`,`locked`,`orig_type`) VALUES 
 ('blog','Blog entry','blog','A <em>blog entry</em> is a single post to an online journal, or <em>blog</em>.','',1,'Title',1,'Body',0,0,1,1,'blog'),
 ('book','Book page','node','A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.','',1,'Title',1,'Body',0,1,1,0,'book'),
 ('grouplanding','Group Landings','node','','',1,'Title',1,'Body',0,1,1,0,''),
 ('groupwikis','Open Goup Page','node','Create a Wiki group post that any group member may edit. New pages sends an email notification to all the group members. ','',1,'Title',1,'Body',0,1,1,0,''),
 ('page','Page','node','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',1,'Title',1,'Body',0,1,1,0,'page'),
 ('question','Questions and Answers','node','','Use this form to create questions for your group or the Elephant Parents community. If posting in a group, other users will get notified of your question. Check back for answers and other related posts! ',1,'Title',1,'Body',0,1,1,0,''),
 ('story','News and Reviews','node','A <em>News & Reviews story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',1,'Title',1,'Body',0,1,1,0,'story');
